import React from 'react';
import Nav from "../components/Nav";
import { withRouter, Link } from "react-router-dom";

class Header extends React.Component {
    render() {
        return (
            <header>
                <div className='container'>
                    <Nav />
                </div>
            </header>
        );
    }
}

export default Header;
